    private static final int[] maxShapeSize = {24, 48};
    private static final double[] shapeAlpha = {0.75, 0.5};

    private final ParallelTransition animation = new ParallelTransition();
    private final Random random = new Random();

    public Leaf() {
        setStroke(null);
        setFill(Color.web("#693F10"));
    }

    public void startFloating(double sceneWidth, double sceneHeight) {
        if (animation.getStatus() == Animation.Status.RUNNING)
            animation.stop();

        int index = (int) Math.round(random.nextDouble(0.6));
        setContent(shape[index]);
        Bounds bounds = getBoundsInLocal();
        double sourceSize = Math.min(bounds.getWidth(), bounds.getHeight());
        double scale = maxShapeSize[index]/sourceSize;
        setOpacity(0.25 + random.nextDouble() * shapeAlpha[index]);
        scale *= getOpacity();

        double startX, startY;
        if (random.nextBoolean()) {
            startX = random.nextDouble() * (sceneWidth * 2 / 3);
            startY = -110;
        } else {
            startX = -110;
            startY = random.nextDouble() * (sceneHeight / 3);
        }

        double endX, endY;
        if (random.nextBoolean()) {
            endX = startX + (sceneWidth - startX) * random.nextDouble();
            endY = sceneHeight + 150;
        }
        else {
            endX = sceneWidth + 150;
            endY = startY + (sceneHeight - startY) * random.nextDouble();
        }

        CubicCurve flightPath = new CubicCurve();
        flightPath.setStartX(startX);
        flightPath.setStartY(startY);
        flightPath.setControlX1(startX + (endX - startX) * 0.4 * random.nextDouble());
        flightPath.setControlY1(startY + (endY - startY) * 0.4 * random.nextDouble());
        flightPath.setControlX2(endX - (endX - startX) * 0.4 * random.nextDouble());
        flightPath.setControlY2(endY - (endY - startY) * 0.4 * random.nextDouble());
        flightPath.setEndX(endX);
        flightPath.setEndY(endY);

        double durationSeconds = 20 + random.nextDouble() * 30;
        Duration duration = Duration.seconds(durationSeconds);

        PathTransition trajectory = new PathTransition(duration, flightPath, this);
        trajectory.setInterpolator(Interpolator.EASE_OUT);

        Timeline flutter = new Timeline();

        int keyFrames = 5;
        for (int i = 0; i <= keyFrames; i++) {
            Duration frameTime = duration.divide(keyFrames).multiply(i);

            double angle = random.nextDouble() * 360 * (random.nextBoolean() ? 1 : -1);

            flutter.getKeyFrames().add(new KeyFrame(frameTime,
                    new KeyValue(scaleXProperty(), scale, Interpolator.EASE_BOTH),
                    new KeyValue(scaleYProperty(), scale, Interpolator.EASE_BOTH),
                    new KeyValue(rotateProperty(), angle, Interpolator.EASE_BOTH)
            ));
        }

        animation.getChildren().clear();
        animation.getChildren().addAll(trajectory, flutter);
        animation.setOnFinished(e -> {
            if (getParent() != null) {
                Bounds b = getParent().getLayoutBounds();
                startFloating(b.getWidth(), b.getHeight());
            } else {
                startFloating(sceneWidth, sceneHeight);
            }
        });
        animation.setDelay(Duration.seconds(20).multiply(random.nextDouble()));
        animation.play();
    }
